import Header from "../../components/header/Header";
import "./Creator.css";

function Creator() {
  return (
    <>
      <Header />
      <body>
      <div className="Airbus">
        <h1>Airbus</h1>
        <h3>Jello</h3>
      </div>
      
      
      </body>
    </>
  );
}

export default Creator;
